pragma solidity >=0.4.21 <0.6.0;

import "../node_modules/@openzeppelin/contracts/ownership/Ownable.sol";
import "./Leaderboard.sol";

contract Gamble is Ownable, Leaderboard {event __CoverageGamble(string fileName, uint256 lineNumber);
event __FunctionCoverageGamble(string fileName, uint256 fnId);
event __StatementCoverageGamble(string fileName, uint256 statementId);
event __BranchCoverageGamble(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageGamble(string fileName, uint256 branchId);
event __AssertPostCoverageGamble(string fileName, uint256 branchId);

    uint public returnRate;

    event win(address indexed add, uint amount);
    event lost(address indexed add, uint amount);

    constructor() public Ownable() {emit __FunctionCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',1);

emit __CoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',13);
        emit __StatementCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',1);
returnRate = 20;
    }

    function() external payable {emit __FunctionCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',2);
 }

    function getBalance() public      returns(uint) {emit __FunctionCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',3);

emit __CoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',19);
        emit __StatementCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',2);
return address(this).balance;
    }

    function setReturnRate(uint _returnRate) public onlyOwner {emit __FunctionCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',4);

emit __CoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',23);
        emit __StatementCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',3);
returnRate = _returnRate;
    }

    function wannaPlayAGame() public payable {emit __FunctionCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',5);

emit __CoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',27);
        emit __StatementCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',4);
uint playerMaxReward = msg.value / 10 * returnRate;
emit __CoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',28);
        emit __AssertPreCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',1);
emit __StatementCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',5);
require(address(this).balance > playerMaxReward, "I'm poor. Cannot play with you! Bye!");emit __AssertPostCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',1);

emit __CoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',29);
        emit __AssertPreCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',2);
emit __StatementCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',6);
require(msg.value >= 2 ether, "I don't play with the poor! Bye!");emit __AssertPostCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',2);


emit __CoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',31);
        emit __StatementCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',7);
if (isBankerWin()) {emit __BranchCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',3,0);
emit __CoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',32);
            emit __StatementCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',8);
enterLeaderBoard(msg.sender, playerMaxReward);
emit __CoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',33);
            emit __StatementCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',9);
msg.sender.transfer(playerMaxReward);
emit __CoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',34);
            emit __StatementCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',10);
emit win(msg.sender, playerMaxReward);
        } else {emit __BranchCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',3,1);
emit __CoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',36);
            emit __StatementCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',11);
emit lost(msg.sender, playerMaxReward);
        }
    }

    function isBankerWin() internal      returns(bool) {emit __FunctionCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',6);

emit __CoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',41);
        emit __StatementCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',12);
return (block.timestamp % 2 == 0) ? true : false;
    }

    function getETH() public onlyOwner {emit __FunctionCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',7);

emit __CoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',45);
        emit __StatementCoverageGamble('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Gamble.sol',13);
msg.sender.transfer(address(this).balance);
    }
}
